import React, { useState } from 'react';
import './ChiptuningBlock.css';
import {
  powerImg,
  dynamicsImg,
  fuelImg,
  smoothImg,
  errorImg,
  safetyImg,
  stage1,
  stage2,
  stage3
} from 'images/chiptuning';

const features = [
  {
    title: 'Creștere putere',
    text: ['Până la +10% la motoare atmosferice', 'Până la +50% la motoare turbo'],
    img: powerImg,
  },
  {
    title: 'Dinamica îmbunătățită',
    text: ['Accelerație mai rapidă și mai lină', 'Schimbări de trepte mai rare'],
    img: dynamicsImg,
  },
  {
    title: 'Economie de combustibil',
    text: ['Reducere consum cu până la 15%', 'Optimizare costuri de exploatare'],
    img: fuelImg,
  },
  {
    title: 'Funcționare lină',
    text: ['Schimbare trepte lină pentru cutii automate', 'Control îmbunătățit al mașinii'],
    img: smoothImg,
  },
  {
    title: 'Corectare erori',
    text: ['Rezolvarea erorilor software din fabrică', 'Optimizarea parametrilor motorului'],
    img: errorImg,
  },
  {
    title: 'Siguranță și fiabilitate',
    text: ['Fără intervenții mecanice majore', 'Păstrarea echilibrului motorului'],
    img: safetyImg,
  },
];

const stages = [
  {
    title: 'STAGE 1',
    desc:
      'Optimizare software ECU (chiptuning) fără modificări hardware. Echilibru putere/consum pentru utilizare zilnică.',
    img: stage1,
  },
  {
    title: 'STAGE 2',
    desc:
      'Chiptuning țintit pentru admisie/evacuare modificate (downpipe, intercooler etc.). Răspuns mai rapid și cuplu mai mare.',
    img: stage2,
  },
  {
    title: 'STAGE 3',
    desc:
      'Setări pentru componente performante (turbo/HP pump, injectoare). Maximizarea performanței cu hardware extins.',
    img: stage3,
  },
];

const accordions = [
  {
    title: 'Chiptuning motor',
    content: `Mulți șoferi cred că își cunosc mașina perfect, dar știați că aceasta are resurse ascunse ce pot fi activate prin chiptuning? 
    Prin ajustarea setărilor ECU, se pot crește puterea și cuplul, reducând în același timp consumul de carburant — totul fără intervenții mecanice majore.`,
  },
  {
    title: 'Chiptuning motoare pe benzină',
    content: `La motoarele pe benzină, optimizarea parametrilor precum amestecul aer-combustibil (AFR), unghiul de avans al aprinderii sau presiunea de supraalimentare 
    (pentru cele turbo) aduce îmbunătățiri clare în putere și răspuns. Pentru motoarele cu injecție directă (CGI, TSI, GDI), faza și cantitatea injecției sunt decisive.`,
  },
  {
    title: 'Avantajele chiptuning-ului pentru diesel',
    content: `• Accelerări mai sigure la depășiri.\n
    • Caracteristici de tracțiune îmbunătățite pentru oraș.\n
    • Mașina se mișcă mai ușor încărcată complet.\n
    • Redă plăcerea condusului după mulți ani de exploatare.\n
    • Mult mai ieftin decât modificări hardware sau un model nou de mașină.`,
  },
  {
    title: 'Chiptuning motoare diesel',
    content: `Motoarele diesel reacționează excelent la chiptuning datorită cuplului disponibil la turații joase. Rezultatul: 
    mai multă putere și dinamism, dar și consum redus de carburant. Astfel, puteți menține viteze mari la turații mai mici, economisind combustibil.`,
  },
  {
    title: 'Ai întrebări?',
    content: `Contactează-ne direct și îți explicăm care este varianta cea mai bună de chiptuning pentru mașina ta.`,
  },
];

export default function Chiptuning() {
  const [open, setOpen] = useState<number | null>(null);

  const toggleAccordion = (idx: number) => {
    setOpen(open === idx ? null : idx);
  };

  return (
    <section id="chiptuning" className="chip">
      <h2 className="chip__title">Ce oferă chiptuning-ul</h2>

      <div className="chip__grid">
        {features.map((f, i) => (
          <article key={i} className="chip__card" aria-label={f.title}>
            <div className="chip__content">
              <h3 className="chip__card-title">{f.title}</h3>
              <ul className="chip__list">
                {f.text.map((line, idx) => (
                  <li key={idx}>{line}</li>
                ))}
              </ul>
            </div>
            <div className="chip__media">
              <img src={f.img} alt="" aria-hidden="true" loading="lazy" />
            </div>
          </article>
        ))}
      </div>

      {/* STAGES row */}
      <div className="chip__stages">
        {stages.map((s, i) => (
          <div key={i} className="chip__stage">
            <img src={s.img} alt="" className="chip__stage-img" />
            <span className="chip__stage-title">{s.title}</span>
            <p className="chip__stage-desc">{s.desc}</p>
          </div>
        ))}
      </div>

      {/* Accordions */}
      <div className="chip__accordions">
        {accordions.map((a, i) => (
          <div
            key={i}
            className={`chip__accordion ${open === i ? 'chip__accordion--open' : ''}`}
          >
            <button className="chip__accordion-header" onClick={() => toggleAccordion(i)}>
              {a.title}
              <span className="chip__accordion-icon">{open === i ? '−' : '+'}</span>
            </button>
            {open === i && <div className="chip__accordion-content"><p>{a.content}</p></div>}
          </div>
        ))}
      </div>
    </section>
  );
}
